import playerList from './scraping/nhl_players.json'

function Test() {
    let nationalities = [];

    playerList.forEach((player) => {
        if (!nationalities.includes(player.nationality)) {
            nationalities.push(player.nationality);
        }
    });

    console.log(nationalities);

    return null;
}

export default Test;
